function PanelAdd(props) {
    return(
      <div className="new-item-panel-container">
      <div className="new-item-panel">
          <form>
              <p>
                  <label htmlFor="">Titulo del Libro</label> <br/>
                  <input type="text" name="title" className="input" />
              </p>

          </form>
      </div>

      </div>
    );
}
export default PanelAdd;
